import React, { useEffect, useState } from 'react';
import userServices from '../services/UserServices';
import { useAuth } from '../context/AuthContext';

const ManageUsers = () => {
    const { user, token } = useAuth();
    const [users, setUsers] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchUsers = async () => {
            try {
                const usersData = await userServices.getAllUsers();
                setUsers(usersData);
            } catch (error) {
                console.error("Error fetching users:", error);
                setError("Failed to fetch users: " + (error.response ? error.response.data.message : error.message));
            }
        };

        // Check if user and token are available before fetching
        if (user && token) {
            fetchUsers();
        } else {
            console.error("User or token is not available. User:", user);
        }
    }, [user, token]); // Dependencies include user and token

    return (
        <div>
            <h2>Manage Users</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <ul>
                {users.map((user) => (
                    <li key={user.id}>{user.coor_fname} {user.coor_lname} - {user.coor_email}</li>
                ))}
            </ul>
        </div>
    );
};

export default ManageUsers;
